import { repeaterData, RepeaterControl } from './gutenberg-repeater-control/index.js';

const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InspectorControls } = wp.blockEditor;
const {
  PanelBody,
  PanelRow,
  TextControl,
  TextareaControl
} = wp.components;

registerBlockType("gb/threecolumnswithintroduction", {
  title: __("Three Columns With Introduction", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "faq",
  attributes: {
    hidden: {
      type: "string|array", // It's a string when persisted but when working on gutenberg it's an array
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentUA: { type: "string", default: `Frequently asked questions` },
    contentt: {
      type: "string",
      default: `Questions. Frequently asked ones. Plus our answers. That's how FAQs work. If you can't find what you're looking for, you can always `,
    },
    contentUB: { type: "string", default: `send us an email` },
    contentUC: { type: "string", default: ` with your enquiry.` },
    contentUD: {
      type: "string",
      default: `What&#039;s the best thing about Switzerland?`,
    },
    contentUE: {
      type: "string",
      default: `I don&#039;t know, but the flag is a big plus. Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cupiditate laboriosam fugiat.`,
    },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <section aria-labelledby="faq-heading" className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>FAQ's</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={10}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Question"
                      value={value.question}
                      onChange={(v) => {
                        value.question = v;
                        onChange(value);
                      }}
                    />,
                    <TextareaControl
                      label="Answer"
                      value={value.answer}
                      onChange={(v) => {
                        value.answer = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-2xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:max-w-7xl lg:px-8">
          
          <div className="max-w-xl">
            
            <h2
              id="faq-heading"
              className="text-2xl font-extrabold tracking-tight text-gray-900"
            >
              <RichText
                value={attributes.contentUA}
                default={"Frequently asked questions"}
                onChange={(newtext) => setAttributes({ contentUA: newtext })}
              />
            </h2>
            <p className="mt-4 text-base text-gray-500">
              <RichText
                value={attributes.contentt}
                default={
                  "Questions. Frequently asked ones. Plus our answers. That's how FAQs work. If you can't find what you're looking for, you can always "
                }
                onChange={(newtext) => setAttributes({ contentt: newtext })}
              />
              <a
                href="#"
                className="font-medium text-indigo-600 hover:text-indigo-500"
              >
                <RichText
                  value={attributes.contentUB}
                  default={"send us an email"}
                  onChange={(newtext) =>
                    setAttributes({ contentUB: newtext })
                  }
                />
              </a>
              <RichText
                value={attributes.contentUC}
                default={" with your enquiry."}
                onChange={(newtext) => setAttributes({ contentUC: newtext })}
              />
            </p>
          </div>
          <dl className="mt-12 grid grid-cols-1 gap-y-10 sm:mt-16 md:grid-cols-2 md:gap-x-6 lg:grid-cols-3">
            
          {arData.map((v) => {
            return (
              <div>  
                <dt className="text-base font-medium text-gray-900">
                  {v.question}
                </dt>
                <dd className="mt-3 text-sm text-gray-500">
                  {v.answer}
                </dd>
              </div>
            )
          })}
          </dl>
        </div>
      </section>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <section aria-labelledby="faq-heading" class="bg-white">
        
        <div class="max-2xl mx-auto py-16 px-4 sm:py-24 sm:px-6 lg:max-w-7xl lg:px-8">
          
          <div class="max-w-xl">
            
            <h2
              id="faq-heading"
              class="text-2xl font-extrabold tracking-tight text-gray-900"
            >
             <RichText.Content value={attributes.contentUA}/>
            </h2>
            <p class="mt-4 text-base text-gray-500">
             <RichText.Content value={attributes.contentt}/>
              <a
                href={
                  attributes.contentUB.match('(.*?)href="(.*?)"(.*?)')
                    ? attributes.contentUB.match('(.*?)href="(.*?)"(.*?)')[2]
                    : attributes.contentUB
                }
                class="font-medium text-indigo-600 hover:text-indigo-500"
              >
                {attributes.contentUB.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                  ? attributes.contentUB.match(
                      "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                    )[0]
                  : attributes.contentUB}
              </a>
             <RichText.Content value={attributes.contentUC}/>
            </p>
          </div>
          <dl class="mt-12 grid grid-cols-1 gap-y-10 sm:mt-16 md:grid-cols-2 md:gap-x-6 lg:grid-cols-3">
          {arData.map((v) => {
            return (
              <div>
                
                <dt class="text-base font-medium text-gray-900">
                  {v.question}
                </dt>
                <dd class="mt-3 text-sm text-gray-500">
                  {v.answer}
                </dd>
              </div>
            )
          })}
          </dl>
        </div>
      </section>
    );
  },
});
